def ncf2df(fname):
    nc = netCDF4.Dataset(fname)
    cols=list(nc.variables)
    d={}
    for c in cols:
        if c=='TFLAG':continue
        a=list(nc.variables[c])
        for i in xrange(3):
            if len(a)==1:
                a=[x for x in a[0]]
            else:
                break
        a=[x[0] for x in a]
        d.update({c: a})
    return DataFrame(d)
